import React from 'react';
import '../css/Main.css';
import logo from '../img/logo.png';

function Main() {
    return (
      <div className="Main">
        <header className="Main-header">
            <img src={logo} className="rentfyLogoMain" alt="logo" />
        </header>
      </div>
    );
}

export default Main;
